    @Override
    public void start(Stage stage) throws Exception {
        SVGPath pulmao; //cria SVGPAth para cada imagem para retornar variveis
        SVGPath rins;
        SVGPath figado;
        SVGPath estomago;
        SVGPath pancreas;
        SVGPath timo;

        pulmao = retNewSVGPath(0);
        rins = retNewSVGPath(1);
        figado = retNewSVGPath(2);
        estomago = retNewSVGPath(3);
        pancreas = retNewSVGPath(4);
        timo = retNewSVGPath(5);

        HBox hbox = new HBox(); // dentro do painel criado o hbox
        hbox.setSpacing(5); //hbox criado para manipulao das imagens
        hbox.setAlignment(Pos.CENTER);
        //hbox.setPadding(new javafx.geometry.Insets(20, 20, 20, 20));
        hbox.setPrefHeight(150);
        hbox.setPrefWidth(150);
        hbox.setMaxHeight(150);
        hbox.setMaxWidth(150);

        hbox.getChildren().addAll(pulmao, rins, figado, estomago, pancreas, timo); //adiciona as imagens 

        pane = new Pane();
        pane.getChildren().add(hbox); //no painel adiciona o hbox

        Scene cena = new Scene(pane, 1100, 600);
        stage.setTitle("Sintoma na rea:");
        stage.setScene(cena);
        stage.setResizable(false);
        stage.show();
    }

    public static void main(String[] args) {
        launch(args);
    }
